import React, { useState } from "react";


const Contact =() =>{

  const[fullname, setFullName] = useState();
  const[phone, setPhone] = useState();
  const[email, setEmail] = useState();

  const nameEvent =(event) =>{
    setFullName(event.target.value);
  }

  const phoneEvent = (event) =>{
    setPhone(event.target.value);

  }

  const emailEvent =(event) =>{
    setEmail(event.target.value);
  }


  const formSubmit =()=>{
    
  };
  return(
    <>
      <div className="my-5">
        <h1 className="text-center">Contact US</h1>

      </div>
      <div className="container contact_div">
        <div className="row">
          <div className="col-md-6 col-10 mx-auto">
            <form onSubmit={formSubmit}>
            <div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">FullName</label>
  <input type="text" required={true} class="form-control" id="exampleFormControlInput1" name="fullname" value={fullname} onChange={nameEvent} placeholder="Enter Your FullName"/>
</div>
<div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">Phone Number</label>
  <input type="number" required={true} class="form-control" id="exampleFormControlInput1" name="phone" value={phone} onChange={phoneEvent} placeholder="Enter Your Phone Number"/>
</div>
<div class="mb-3">
  <label for="exampleFormControlInput1" class="form-label">E-mail</label>
  <input type="email" required={true} class="form-control" id="exampleFormControlInput1" name="email" value={email} onChange={emailEvent} placeholder="Enter Your E-mail"/>
</div>

<div class="mb-3">
  <label for="exampleFormControlTextarea1" class="form-label">Message</label>
  <textarea required={true} class="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
</div>
<div class="col-12">
    <button class="btn btn-outline-primary" type="submit">Submit form</button>
  </div>

            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default Contact;
